import './Post.css';

const Post = ({ post }) => {
  const { imageUrl, title, text } = post;

  return (
    <div className="post">
      <img src={imageUrl} alt={title} />
      <h3>{title}</h3>
      <p>{text}</p>
    </div>
  );
}

export default Post;
